import React from 'react';
import { StatusBar } from 'expo-status-bar';
import { Text, View, StyleSheet, ScrollView, TextInput, Button, TouchableOpacity, Image, ImageBackground } from 'react-native';

class Login extends React.Component{
  constructor(props){
    super(props);
  }
  render(){
    const navigation = this.props.navigation;
    return (
      <ImageBackground style={{flex:1}}
      source={require('../assets/bg.png')}>
<ScrollView>
        <View style={styles.container}>
          <Image
            style={{
              width: 140,
              height: 140,
              marginTop: 26
            }}
            resizeMode={'cover'}
             source={require('../assets/app-icon.jpg')}
          />
          <Text
            style={{
              fontSize: 18,
              marginBottom: 16,
              marginTop: 16,
              fontWeight: 'bold'
            }}>Sign In</Text>
  
          <Text style={styles.textLabel}>Email</Text>
          <TextInput style={styles.textInput}
            placeholder="Email Address"
          />
  
          <Text style={styles.textLabel}>Password</Text>
          <TextInput
            style={styles.textInput}
            placeholder="Password"
          />
          
          <TouchableOpacity onPress={() => {navigation.navigate("ForgetPassword")}}>
            <Text style={{
              marginBottom: 16,
              marginTop: 16,
              color: '#4D4D4D',
              fontWeight: 'bold'
            }}>Forgot Password?</Text>
          </TouchableOpacity>
            
          <View style={[{
            width: "94%",
            marginStart: 10,
            marginEnd: 10,
            marginTop: 8,
            marginBottom: 16,
            backgroundColor: "#00C8E4",
            borderRadius: 4,
          }]}>
            <Button
              title="Sign In"
              color="#00C8E4"
              onPress={() =>
                navigation.navigate('App')
              }
            />
          </View>
  
          <Text
            style={{
              fontSize: 16,
              marginBottom: 16,
              color: "#808080"
            }}>Sign in with Social Account</Text>
  
          <View style={styles.buttonContainer}>
            <View style={[{
              width: "46%",
              marginEnd: 8,
              backgroundColor: "#00C8E4",
              borderRadius: 4,
            }]}>
              <Button title="Facebook" />
            </View>
            <View style={[{
              width: "46%",
              marginStart: 8,
              backgroundColor: "#00C8E4",
              borderRadius: 4,
            }]}>
              <Button title="Google" />
            </View>
          </View>
          <Text
            style={{
              fontSize: 16,
              marginBottom: 16,
              marginTop: 32,
              color: "#1A1A1A"
            }}>Don't have an account?</Text>
  
          <View style={[{
            width: "94%",
            marginStart: 10,
            marginEnd: 10,
            marginTop: 8,
            marginBottom: 16,
            backgroundColor: "#fff",
            borderRadius: 4,
          }]}>
            <Button
              title="SignUp"
              color="#00C8E4"
              onPress={() =>
                navigation.navigate('SignUp')
              }
            />
          </View>
          <StatusBar style="auto" />
        </View>
  
      </ScrollView>
  
      </ImageBackground>
      
    );
  }
}
export default Login;

const styles = StyleSheet.create({
  container: {
    width: "100%",
    height: "100%",
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo: {
    width: 66,
    height: 58,
  },
  buttonContainer: {
    width: '100%',
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'center',
  },
  checkboxContainer: {
    flexDirection: "row",
    marginBottom: 20,
  },
  textHeading: {
    width: '47%',
    fontSize: 18,
    marginStart: 16,
    marginBottom: 16,
    marginTop: 32,
    fontWeight: 'bold'
  },
  textLabel: {
    textAlign: 'left',
    marginStart: 8,
    marginBottom: 8,
    color: '#4D4D4D',
    marginTop: 16,
    fontWeight: 'bold',
    width: "94%",
  },
  textInput: {
    height: 40,
    width: "94%",
    padding: 10,
    borderRadius: 4,
    borderColor: 'gray',
    backgroundColor: '#FFFFFF',
    borderWidth: 1,
  },

  buttonStyle: {
    width: "46%",
    marginEnd: 8,
    backgroundColor: "#00C8E4",
    borderRadius: 40,
  },
  buttonStyleWhite: {
    width: "46%",
    marginEnd: 8,
    backgroundColor: "#E6E6E6",
    borderRadius: 40,
  },
  containerList: {
    width: "100%",
    marginTop: StatusBar.currentHeight || 0,
  },
  item: {
    backgroundColor: '#FFFFFF',
    padding: 8,
    width: "92%",
    alignItems: 'center',
    justifyContent: 'center',
    borderRadius: 8,
    marginVertical: 8,
    marginHorizontal: 16,
  },
  title: {
    fontSize: 32,
  },
  textBorder: {
    width: "50%",
    fontSize: 11,
    color: '#333333',
    fontWeight: 'bold',
    marginTop: 4,
    marginEnd: 4,
    marginStart: 4,
    borderRadius: 4,
    borderColor: '#E6E6E6',
    borderWidth: 1, padding: 4
  },
});
